  "privacy_rights_title": "Diritti dell’interessato",
  "privacy_rights_txt": "Nella sua qualità di Interessato e partecipante al progetto, ha il diritto in qualunque momento di ottenere la conferma dell’esistenza o meno dei medesimi dati e di conoscerne il contenuto e l’origine, gode altresì dei diritti di cui alla sezione 2, 3 e 4 del capo III del GDPR (es. chiedere al titolare del trattamento: l'accesso ai dati personali e la rettifica o la cancellazione degli stessi; la limitazione del trattamento che lo riguardano; di opporsi al loro trattamento, oltre al diritto alla portabilità dei dati). L’interessato ha diritto a chiedere al titolare, ai sensi degli artt. 15, 16, 17, 18, 19, 20 e 21 del GDPR, l’accesso ai propri dati personali e la rettifica o la cancellazione degli stessi o la limitazione del trattamento che lo riguardano o di opporsi al loro trattamento, oltre al diritto alla portabilità dei dati. La cancellazione non è consentita per i dati contenuti negli atti che devono obbligatoriamente essere conservati dall’Università; Inoltre ha diritto a revocare il consenso in qualsiasi momento, senza pregiudicare la liceità del trattamento basata sul consenso prestato prima della revoca; Ai sensi dell’art. 17, comma 3, lett. d) del GDPR, il diritto alla cancellazione non sussiste per i dati il cui trattamento sia necessario ai fini di ricerca scientifica qualora rischi di rendere impossibile e/o pregiudicare gravemente gli obiettivi della ricerca stessa.",
